export default function Line (props) {
console.log(props);
console.log(props.daysArrayChart);




  const data = React.useMemo(
    () => [
      {
        label: 'Series 1',
        data: props.daysArrayChart
        // data: [[0,1],[1,-13],[2,65], [3,105],[4,0]]
